import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Navigation from './components/Navigation';
import LandingPage from './components/Landing';

import Footer from './Footer';
import * as ROUTES from './constants/routes';
import { withAuthentication } from '../Session';
import "./css/styles.css";

import { createBrowserHistory } from 'history';

const browserHistory = createBrowserHistory();

const App = () => (
      <Router>
      <ScrollToTop />
      <div>
      <Navigation />
      <div className="navbar-padding">
        <Switch>
        <Route exact path={ROUTES.LANDING} component={LandingPage} />
        <Route exact path={ROUTES.SIGN_UP} component={SignUpPage} />
        <Route exact path={ROUTES.SIGN_IN} component={SignInPage} />
        <Route exact path={ROUTES.DONATE} component={Donate} />
        <Route exact
          path={ROUTES.PASSWORD_FORGET}
          component={PasswordForgetPage}
        />
        <Route exact path={ROUTES.ACCOUNT} component={AccountPage} />
        <Route exact path={ROUTES.ADMIN} component={AdminPage} />
        <Route exact path={ROUTES.BOOKS} component={Books} />
        <Route exact path={ROUTES.PROBLEM} component={TheProblem} />
        <Route exact path={ROUTES.MISSION} component={OurMission} />
        <Route exact path={ROUTES.DO} component={WhatWeDo} />
        <Route exact path={ROUTES.TEAM} component={OurTeam} />
        <Route exact path={ROUTES.CONTACT} component={ContactUs} />
        <Route exact path={ROUTES.VOLUNTEER} component={Volunteer} />
        <Route exact path={ROUTES.BOOKDETAILS} component={BookDetails} />
        <Route exact path={ROUTES.BAG} component={Bag} />
        <Route exact path={ROUTES.CHECKOUT} component={Checkout} />
        <Route exact path={ROUTES.WISHLIST} component={Wishlist} />
        <Route exact path={ROUTES.HISTORY} component={OrderHistory} />
        <Route exact path={ROUTES.BLOG} component={Blog} />
        <Route component={NotFound} />
        </Switch>
        <Footer />
      </div>

      </div>
  </Router>

);

export default App;
